comment:
첫번째 배댓님 딱 내 생각을 말해줬네.
웹툰 보면서 멍청한 것들이 왠지 팩폭이니 뭐니 말할 것 같은 예감이 들었는데
역시 나쁜 예감은 틀리지를 않는군;

존나 유명하고 특별한 사람들이랑만 비교해서 
그사람들은 이렇게 잘나가고 돈잘벌어서 부모님 호강시켜주는데 넌 왜그러냐고? 이게 뭔 개똥 팩트여 
그렇게 따지면 소개팅에서 20대 후반 30대초반 남자한테 차있냐 집있냐 직업뭐냐 물어보고 없으면 무시하는것도 다 팩폭이냐 ㅋㅋㅋㅋㅋ 저런사람들이 특이한 케이스인거지 ㅋㅋㅋㅋㅋ 25살이 많이먹은거야? 진짜 남자는 고등학교 졸업하고 대학갔다가 군대갔다오고 하면 25살에 갓 대학 졸업하거나 대학안가면 이제 막 사회에서 자리잡을 나이 아니냐 25살에 뭘 이뤄야 된다는 발상은 어디서 나온 개똥같은 발상이냐 뭐 요즘 수명이 평균 50세까지도 아니고;;; 이런거에 데미지 입을필요 없다;;; 어이가 아리마셍;

하 진짜 거짓말안하고 내용 겁나 기분나쁜데?
 아니 기분 나쁘다기보단 역겨움 무슨 1화부터 깊은 의미를 담은 척 사회비판을하는 척 ;;;
 실제론 걍 더러운 남의 자격지심이나 한껏 들어준 기분임ㅋㅋㅋ 
스토리민큼 그림체도 기분나쁘고 답답함 인체는 배웠는지;;ㅋㅋㅋ손그리기 어려워 하는 티 낭낭함 웹툰작가가 어떻게 됐는지 신기할다름 ㅋㅋㅋㅋㅋ
사람들 지금은 명작명작하지만 얼마못가 바닥에 있을게뻔하다
대사하나하나  너무 자극적이고 별 생각없이 쓴게 보임ㅋㅋㅋㅋㅋㅋ;;

현실부정좀 하지마;; 축구선수 연예인 모두 우리와 같은 사람이야
그저 노력을 얼마나 하는지 그 일을 얼마나 즐기는지 자신의 진로를 어떻게 잡았는지에 따라 바뀌는건데 이 모든걸 생각도 안해본 사람들이 맨날 비교하지마라 자존감 낮추지마라 이딴 말이나 하고 다니지
이때까지 살면서 1시간이라도 자신에 대해 어떻게 살지 고민이라도 해본적 있어? 생각없이 남들 다하는 공부따라하다가 주인공처럼 되는거지;;

너그들이 남과 비교 안하고 산다해도 사회는 다 비교해;;
모든 세상살이가 너희 마음대로 되는줄 아나;
불편하면 이겨내던지 회피하려들고있네 루저들;;

혹시 내가 놓친 부분이 있나 해서 다시 읽었지만 역시 내가 읽기엔 너무 정신건강에 해롭다 ㅜㅜ;;
내가 물론 공부 열심히 안하고 꿈도 딱히 없어서 적당히 살아서 지금 돈을 많이 버는것도 아니지만
그냥 적당히 수수하게 살기에 그리 부족하진 않겠다 하고 만족하고 사는데
이 웹툰을 읽으니 생각보다 큰 충격이 있네요..;;

아니..핰ㅋㅋㅋㅋㅋ주인공 고구마 1000개 먹었나;;
오ㅐ 말을 못해 그리고 그옆에 남자 갸때리고 싶다
여자는 왜케 씨비거는거여 안그래도 불쌍한 남주를;;

와;;개발암ㄷㄷ
지는 성형한거 가지고 죄없다고 떠들면서
남자한텐 좀 스타일 따라한다고 촌스럽데;
진짜 말과 행동에 일관성이 없네;

와 진짜 이해 못하겟네 어떻게 그런 발상을 하냐?;;;
한사람 까내리고 사진보고 조롱할려는데 
그거 화낸게 잘못된일이냐?;;; 인간적으로 하면 안되는짓이잖아;;
